import React from 'react';

type VentProps = {
    leftOnePercent: number
    leftTwoPercent: number;
    rightOnePercent: number
    rightTwoPercent: number;
};

const Vents: React.FC<VentProps> = ({ leftOnePercent, 
    leftTwoPercent, rightOnePercent, rightTwoPercent }) => {
    return (
        <div>

            <GroupedShapes/>
        </div>
    );
};

const GroupedShapes = () => {
    return (
      <svg width="200" height="200">
        {/* Grouping shapes using <g> element */}
        <g>
          <circle cx="50" cy="50" r="30" fill="blue" />
          <rect x="80" y="20" width="40" height="60" fill="red" />
        </g>

        {/* Another group of shapes */}
        <g transform="translate(120, 120)">
          <rect x="0" y="0" width="50" height="50" fill="green" />
          <ellipse cx="25" cy="25" rx="20" ry="15" fill="yellow" />
        </g>
      </svg>
    );
  };

export default Vents
